import React from 'react';
import './App.css';
import Todo from './components/todo/todo';

const App = () => {
	const todos = [
		{ id: 1, completed: false, }
	]
	return (
		<div className={'container'} >
			<h1>React todo list</h1>
			<Todo />
		</div>
	)
}

export default App;
